import SubSidebar from "./SubSidebar";
import User from "./User";
import { Link } from "react-router-dom";
function Sidebar() {
  return (
    <Card
      style={{
        width: "18rem",
        float: "left",
        backgroundColor: "gray",
        width: "300px",
        height: "90vh",
        margin: "10px",
      }}
      className="Sidebar"
    >
      <Card.Header>
        <User src="./assets/img/user.png" name={"Hozifa Siddig Mohammed"} />
      </Card.Header>

      <Link to="/">
        <SubSidebar src="./assets/icons/credit-card.svg" name="Payment" />
      </Link>
      <SubSidebar src="./assets/icons/credit-card.svg" name="Payment" />
      <SubSidebar src="./assets/icons/credit-card.svg" name="Payment" />
      <SubSidebar src="./assets/icons/credit-card.svg" name="Payment" />
      <SubSidebar src="./assets/icons/credit-card.svg" name="Payment" />
      <SubSidebar src="./assets/icons/credit-card.svg" name="Payment" />

      <Card.Footer
        style={{ position: "absolute", bottom: "0px", width: "100%" }}
      >
        <SubSidebar src="./assets/icons/box-arrow-left.svg" name="Logout" />
      </Card.Footer>
    </Card>
  );
}

export default Sidebar;
